DECLARE @Today DATETIME = '2023-10-24 10:00:00 AM'

CREATE TABLE #ModMaintenanceHistory
( 
	SerialNumber VARCHAR(100),
	ModName VARCHAR(10),
	RepairDate DATETIME
)


CREATE TABLE #ModCbmMonitorMapping (ModName VARCHAR(10), CbmMonitorId INT)


--SELECT * 
