--JOIN CBMMonitor cm on m.CbmMonitorId = cm.CBMMonitorId

BEGIN TRAN

DELETE FROM PFTWO where WO_NO like 'PFTMOD%'

           ,[WO_NO]
           ,[WorkOrderId]
           ,[BranchPlant]
           ,[FixedAssetId]
           ,[AssetNumber]
           ,[ItemNum]
           ,[PFTConfigId]
           ,[Active]
           ,[CurPFTWOSeqId]
           ,[UserIdAdded]
           ,[Revision]
           ,[IsDynamic]
           ,[ReferenceDocs]
           ,[SerialNum]
           ,[IncidentNum]
           ,[JobNum]
           ,[Combo]
           ,[IsDebug]
           ,[IsRTV]
           ,[DateAdded]
           ,[PFTType]
           ,[FWSensorId]
           ,[SensorName]
           ,[NCRRequestId]
           ,[JDEWorkOrderNum]
           ,[AssetRepairTrackId]
           ,[UpdatedBy]
           ,[ReasonForChange])
SELECT 
           NEWID() PFTWOId
           ,'PFTMOD'+ CONVERT(VARCHAR(4), ROW_NUMBER() OVER(ORDER BY parentFixedAsset.AssetNumber)) WO_NO -- TODO: Have to get logic added for building
           ,null WorkOrderId
           ,0 BranchPlant
           ,parentFixedAsset.FixedAssetId
           ,parentFixedAsset.AssetNumber
           ,parentFixedAsset.InventoryItemNum
           ,pc.PFTConfigId
           ,0 Active
           ,NULL CurPFTWOSeqId
           ,0 UserIdAdded
           ,NULL Revision
           ,0 IsDynamic
           ,NULL ReferenceDocs
           ,parentFixedAsset.SerialNum
           ,NULL IncidentNum
           ,NULL JobNum
           ,NULL Combo
           ,0 IsDebug
           ,0 IsRTV
           ,history.[RepairDate] DateAdded
           , 3 PFTType
           ,NULL FWSensorId
           ,NULL SensorName
           ,NULL NCRRequestId
           ,NULL JDEWorkOrderNum
           ,NULL AssetRepairTrackId
           ,NULL UpdatedBy
           ,'Closed - Passed' ReasonForChange
		   --modcbm.CbmMonitorId
	FROM CBMMonitor c (NOLOCK) 
		JOIN CBMMonitorAssetItemNums pItem (NOLOCK) on c.CBMMonitorId = pItem.CBMMonitorId and pItem.IsParent = 1
		JOIN CBMMonitorAssetItemNums cItem (NOLOCK) on pItem.CBMMonitorId = cItem.CBMMonitorId and cItem.IsParent = 0
		JOIN FixedAssets f (NOLOCK) on f.InventoryItemNum = cItem.ItemNum
		JOIN FixedAssets parentFixedAsset (NOLOCK) ON ISNULL(f.TopLevelFixedAssetId, f.FixedAssetId) = parentFixedAsset.FixedAssetId and pItem.ItemNum = parentFixedAsset.InventoryItemNum
		JOIN PFTConfig pc (NOLOCK) ON c.ObjectNumber = pc.ObjectNumber AND pc.IsObsolete = 0
		JOIN #ModCbmMonitorMapping modcbm on c.CBMMonitorId = modcbm.CbmMonitorId 
		LEFT JOIN PFTWO p on p.FixedAssetId = f.FixedAssetId and p.PFTConfigId = pc.PFTConfigId
		JOIN (SELECT 
					SerialNumber, 
					ModName, 
					MAX(RepairDate) [RepairDate]
				FROM #ModMaintenanceHistory  
				GROUP BY SerialNumber, ModName
			)history on f.SerialNum = history.SerialNumber and modcbm.ModName = history.ModName
order by SerialNum

